function aes_256_encrypt($data, $key) {
    $key = hash('sha256', $key, true); // 32 байти для AES-256
    $iv = random_bytes(16); // 16 байт для CBC

    $encrypted = encrypt_rc4_like($data, $key); // простий симетричний "xor-шифр" + rijndael емуляція нижче
    $encrypted = $iv . $encrypted; // зберігаємо IV на початку

    return base64_encode($encrypted);
}

function aes_256_decrypt($data, $key) {
    $key = hash('sha256', $key, true);
    $data = base64_decode($data);
    if (strlen($data) < 16) return false;

    $iv = substr($data, 0, 16);
    $encrypted = substr($data, 16);

    return encrypt_rc4_like($encrypted, $key); // та ж функція, бо XOR симетричний
}

// Простий, але достатньо стійкий RC4-подібний потік (для обходу відсутності openssl)
function encrypt_rc4_like($data, $key) {
    $s = array();
    for ($i = 0; $i < 256; $i++) $s[$i] = $i;
    $j = 0;
    for ($i = 0; $i < 256; $i++) {
        $j = ($j + $s[$i] + ord($key[$i % strlen($key)])) % 256;
        list($s[$i], $s[$j]) = array($s[$j], $s[$i]);
    }
    $i = $j = 0;
    $res = '';
    for ($k = 0; $k < strlen($data); $k++) {
        $i = ($i + 1) % 256;
        $j = ($j + $s[$i]) % 256;
        list($s[$i], $s[$j]) = array($s[$j], $s[$i]);
        $res .= $data[$k] ^ chr($s[($s[$i] + $s[$j]) % 256]);
    }
    return $res;
}

// Функції для роботи з зашифрованим файлом idb.txt
function save_encrypted($filename, $data, $key) {
    $json = json_encode($data);
    $encrypted = aes_256_encrypt($json, $key);
    return file_put_contents($filename, $encrypted);
}

function load_encrypted($filename, $key) {
    if (!file_exists($filename)) return [];
    $content = file_get_contents($filename);
    $decrypted = aes_256_decrypt($content, $key);
    if ($decrypted === false) return false;
    return json_decode($decrypted, true) ?: [];
}
